import React from 'react';
import { StyleSheet, Form, FormGroup, FormControl} from 'react-native';

export default function AddEntry({navigation}) {
    const [mood, setMood] = React.useState("");
    const handleMoodChange = event => setMood(event.target.value);

    return(
       <Form>
           <Form.Group controlId="moodEntry">
            <Form.Label>Mood</Form.Label>
            <Form.Control type="entry" placeholder="Enter mood" />
           </Form.Group>
       </Form>
    )
}
